import React from 'react';
import { Outlet } from "react-router-dom";
import { Container, Row } from 'react-bootstrap';
import Navigation from '../Navigation/Navigation';

const layout = (props) => {
    return (
        <>
        <Container>
            <Row>
                <Navigation/>
            </Row>
            <main>
                {props.children}
            </main>
            </Container>
            
            </>
    )
}

export default layout;
